window.bookSummaryJSON = "<p><i>BONUS! Contains a fun question &amp; answer session between narrators Jason Clarke &amp; Erin Mallon during the last ten minutes of the recording.</i></p> <p>I know it’s time to move on from my rocky past and get back out there and start dating again.&nbsp;</p> <p>It’s just that every time I think about it, I get all nervous and sweaty.&nbsp;</p> <p>Good thing I have a secret weapon to help me - my best friend, professional hockey stud Owen Parrish.&nbsp;</p> <p>He’s the king of hookups, and promises he’ll be my guide through the world of online dating. With his help, I know this won’t be as hard.&nbsp;</p> <p>•</p> <p>I’ve never been this hard in my entire life.&nbsp;</p> <p>My friend Becca wants my help hooking her up with some douchey guy from a dating app.&nbsp;</p> <p>I said I’d help her - but now I’m noticing all kinds of things I can’t ignore, like how pretty she is behind those baggy clothes and messy buns.&nbsp;</p> <p>I want to be the one to help her, to show her the ropes in the bedroom, and it turns out, Becca’s game to let me take a more hands-on approach.&nbsp;</p> <p>But what happens when she’s ready to take her newfound confidence and move on? I’ve never been boyfriend material, but for her, I want to try.&nbsp;</p> <p><i>Your favorite hot jocks are back with an all new stand-alone novel. If you like sexy, confident men who know how to handle a stick (on and off the ice), and smart women who are strong enough to keep all those big egos in check, this series is for you! </i></p> <p>(Books can be enjoyed in any order.)</p>"; 
